"""
This script assumes that each Fasta file contains only one sequence
"""
from pathlib import Path

import numpy as np
import pandas as pd
from Bio import SeqIO
from joblib import Parallel, delayed
from matplotlib import pyplot as plt

from embedding_sequence.abstract_embedding import AbstractEmbedding
from embedding_sequence.fcgr.fcgr import FCGR


class FCGREmbedding(AbstractEmbedding):

    def __init__(self, data_dir=None, output_dir=None, min_size=None, max_size=None, overlap_percent=None, kmer=6,
                 fold=1, is_train=True):
        super().__init__(
            embedding_type="fcgr",
            data_dir=data_dir,
            output_dir=output_dir,
            min_size=min_size,
            max_size=max_size,
            overlap_percent=overlap_percent,
            fold=fold,
            is_train=is_train
        )

        self.kmer = kmer
        self.fcgr = FCGR(kmer)
        self.counter = 0  # count number of time a sequence is converted to fcgr

    def run(self, sequences, labels):
        fcgr_representations = []
        result_labels = []

        df = pd.DataFrame(zip(sequences, labels), columns=['sequence', 'label'])
        results = Parallel(n_jobs=-1)(
            delayed(self._sequence_to_fcgr)(
                (idx, row)
            ) for idx, row in df.iterrows()
        )

        for result in results:
            if result is not None and len(result) > 0:
                fcgr_representations.append(result[0])
                result_labels.append(result[1])

        return np.array(fcgr_representations), np.array(result_labels)

    def _sequence_to_fcgr(self, tuple):
        idx, row = tuple
        sequence = row['sequence']
        label = row['label']
        seq = self.preprocessing(sequence)
        chaos = self.fcgr(seq)
        # np.save(path_save, chaos)
        self.counter += 1
        return chaos, label

    def reset_counter(self):
        self.counter = 0

    @staticmethod
    def preprocessing(seq):
        seq = seq.upper()
        for letter in "BDEFHIJKLMOPQRSUVWXYZ":
            seq = seq.replace(letter, "N")
        return seq

    @staticmethod
    def load_fasta(path: Path):
        return SeqIO.parse(path, "fasta")

    def visualize_fcgr(self, sequence: str, title: str = "FCGR Representation"):
        """
        Visualize FCGR representation của một sequence
        """
        seq = self.preprocessing(sequence)
        fcgr_matrix = self.fcgr(seq)

        plt.figure(figsize=(8, 8))
        plt.imshow(fcgr_matrix, cmap='hot', interpolation='nearest')
        plt.colorbar(label='Frequency')
        plt.title(f"{title}\nSequence length: {len(sequence)}")
        plt.xlabel('X coordinate')
        plt.ylabel('Y coordinate')
        plt.show()

        return fcgr_matrix


if __name__ == '__main__':
    embedding = FCGREmbedding()
    embedding.visualize_fcgr(
        "")
